window.bookSummaryJSON = "<p>The finale to the Zone War series.</p> <p>Alone and weaponless, with a remote controlled bomb in his neck, Ajaya Gurung must plan and fight better and harder than ever before. The last Spider is out there, in the Zone, plotting the end of man, and man is ignoring the danger. Left with only his skills, wits, and courage, he must adapt and overcome before it's too late. If only he had an ace in the hole...oh wait...he does!</p>"; 
